import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
                        <div style={{textAlign:"left"}}>
                <h2 style={{color:'red', fontFamily:'monospace'}}>Hello there! My name is Tasnim Ali and I am a software developer who designs fullstack web applications. </h2>
                <h2 style={{color:'red', fontFamily:'monospace'}}>Hopefully I can help you with your next project?</h2>
            </div>
        );
    }
}

export default Home;
